  /// <summary>
  /// 지정한 PathIconType에 해당하는 Geometry 객체를 반환합니다.
  /// </summary>
  /// <param name="type">아이콘의 종류 (PathIconType 열거형 값)</param>
  /// <returns>
  /// 아이콘 타입에 해당하는 Geometry 개체를 반환하거나,
  /// 사전에 해당 타입이 등록되지 않은 경우 null을 반환합니다.
  /// </returns>
  public static Geometry? GetGeometry(PathIconType type)
  {
    // Dictionary.TryGetValue 를 사용하여 키가 존재하면 geometry에 값을 저장하고 true 를 반환합니다.
    // 키가 없으면 geometry 는 null이고 false 를 반환합니다.
    _pathData.TryGetValue(type, out Geometry? geometry);

    // 결과적으로 geometry가 null일 수 있으므로, 반환형은 Geometry?입니다.
    return geometry;
  }
